import React from 'react';
import * as style from "../css/pageIndex";

export default function Pages(props) {
  let total = props.total

  const renderPageList = () => {
    let pages = []
    for (let i=1; i<total.device; i++) {
      pages.push(<div style={{marginRight: "4px"}}>{i}</div>)
    }
    console.log(pages)
    return pages
  }

  return (
    <div style={{display: "flex"}}>
      <div style={style.leftArrow}/>
        <div>1</div>
        <div style={{display: "flex"}}>
          {renderPageList()}
        </div>
      <div style={style.rightArrow}/>
    </div>
  )
}
